import React from "react";

export const BasketPrewiewItem = ({ item }) => {
  console.log(item.item.name);
  return (
    <div
      style={{ width: "100%", height: "50px", backgroundColor: "aliceblue" }}
    >
      <img src={process.env.REACT_APP_API_URL + item.item.img[0]}></img>
      {item.item.name}
      {item.count}
    </div>
  );
};
